using CoreGraphics;
using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIDocumentinteractionControllerDelegate_protocol/index.html#//apple_ref/occ/intf/UIDocumentinteractionControllerDelegate	/// <summary>	/// The UIDocumentinteractionControllerDelegate protocol includes methods you can implement to respond to messages from a document interaction controller. Use this protocol to participate when document previews are displayed and when a document is about to be opened by another application. You can also use this protocol to respond to commands (such as “copy” and “print”) from a document interaction controller’s options menu.	/// </summary>	[iOSVersion(3.2)]	public interface UIDocumentinteractionControllerDelegate	{		/// <summary>		/// Called when a document interaction controller needs a view controller for presenting a document preview.		/// </summary>		/// <param name="controller">The document interaction controller requesting the parent view controller.</param>		/// <returns>The view controller to use when presenting the document preview. The return value must not be nil.</returns>		[iOSVersion(3.2)]		[Export("documentinteractionControllerViewControllerForPreview")]		[Optional]		UIViewController DocumentinteractionControllerViewControllerForPreview(UIDocumentinteractionController controller);				/// <summary>		/// Called when a document interaction controller needs the starting point for animating the display of a document preview.		/// </summary>		/// <param name="controller">The document interaction controller requesting the starting view.</param>		/// <returns>The view to use as the starting point for the animation or nil if you want the document preview to fade into place.</returns>		[iOSVersion(3.2)]		[Export("documentinteractionControllerViewForPreview")]		[Optional]		UIView DocumentinteractionControllerViewForPreview(UIDocumentinteractionController controller);				/// <summary>		/// Called when a document interaction controller needs the rectangle to use as the starting point for animating the display of a document preview.		/// </summary>		/// <param name="controller">The document interaction controller requesting the starting rectangle.</param>		/// <returns>A rectangle in the coordinate system of the view returned by the documentinteractionControllerViewForPreview: method.</returns>		[iOSVersion(3.2)]		[Export("documentinteractionControllerRectForPreview")]		[Optional]		CGRect DocumentinteractionControllerRectForPreview(UIDocumentinteractionController controller);				/// <summary>		/// Called when a document interaction controller is about to display a preview for its document.		/// </summary>		/// <param name="controller">The document interaction controller that is about to preview its document.</param>		[iOSVersion(3.2)]		[Export("documentinteractionControllerWillBeginPreview")]		[Optional]		void DocumentinteractionControllerWillBeginPreview(UIDocumentinteractionController controller);				/// <summary>		/// Called when a document interaction controller has dismissed its document preview.		/// </summary>		/// <param name="controller">The document interaction controller that dismissed its document preview.</param>		[iOSVersion(3.2)]		[Export("documentinteractionControllerDidEndPreview")]		[Optional]		void DocumentinteractionControllerDidEndPreview(UIDocumentinteractionController controller);				/// <summary>		/// Called when a document interaction controller is about to display an options menu.		/// </summary>		/// <param name="controller">The document interaction controller that is about to display an options menu.</param>		[iOSVersion(3.2)]		[Export("documentinteractionControllerWillPresentOptionsMenu")]		[Optional]		void DocumentinteractionControllerWillPresentOptionsMenu(UIDocumentinteractionController controller);				/// <summary>		/// Called when a document interaction controller has dismissed its options menu.		/// </summary>		/// <param name="controller">The document interaction controller that dismissed its options menu.</param>		[iOSVersion(3.2)]		[Export("documentinteractionControllerDidDismissOptionsMenu")]		[Optional]		void DocumentinteractionControllerDidDismissOptionsMenu(UIDocumentinteractionController controller);				/// <summary>		/// Called when a document interaction controller is about to display an Open In menu.		/// </summary>		/// <param name="controller">The document interaction controller that is about to display a menu.</param>		[iOSVersion(3.2)]		[Export("documentinteractionControllerWillPresentOpenInMenu")]		[Optional]		void DocumentinteractionControllerWillPresentOpenInMenu(UIDocumentinteractionController controller);				/// <summary>		/// Called when a document interaction controller has dismissed its Open In menu.		/// </summary>		/// <param name="controller">The document interaction controller that dismissed its menu.</param>		[iOSVersion(3.2)]		[Export("documentinteractionControllerDidDismissOpenInMenu")]		[Optional]		void DocumentinteractionControllerDidDismissOpenInMenu(UIDocumentinteractionController controller);				/// <summary>		/// Called when a document interaction controller’s document is about to be opened by the specified application.		/// </summary>		/// <param name="controller">The document interaction controller whose document is about to be opened.</param>		/// <param name="willBeginSendingToApplication">The bundle identifier of the application that is about to open the document. This value corresponds to the value in the CFBundleIdentifier key of the application’s Info.plist file.</param>		[iOSVersion(3.2)]		[Export("documentinteractionController")]		[Optional]		void DocumentinteractionController(UIDocumentinteractionController controller, string willBeginSendingToApplication);				/// <summary>		/// Called when a document interaction controller’s document has been handed off to the specified application.		/// </summary>		/// <param name="controller">The document interaction controller whose document is about to be opened.</param>		/// <param name="didEndSendingToApplication">The bundle identifier of the application that is about to open the document. This value corresponds to the value in the CFBundleIdentifier key of the application’s Info.plist file.</param>		[iOSVersion(3.2)]		[Export("documentinteractionController")]		[Optional]		void DocumentinteractionController(UIDocumentinteractionController controller, string didEndSendingToApplication);				/// <summary>		/// Called when a document interaction controller needs to know whether the specified action can be performed on the associated document.				 		  Deprecation Statement		  		 Apps should use UIActivityViewController for actions.		/// </summary>		/// <param name="controller">The document interaction controller managing an associated document.</param>		/// <param name="canPerformAction">The selector representing the action in question.</param>		/// <returns>true if the specified action is supported for the associated document or false if it is not. If you do not implement this method, the return value is assumed to be false.</returns>		[Obsolete]		[iOSVersion(3.2)]		[Export("documentinteractionController")]		[Optional]		bool DocumentinteractionController(UIDocumentinteractionController controller, Selector canPerformAction);				/// <summary>		/// Called when a document interaction controller wants its delegate to perform a specified action with the associated document.				 		  Deprecation Statement		  		 Apps should use UIActivityViewController for actions.		/// </summary>		/// <param name="controller">The document interaction controller managing an associated document.</param>		/// <param name="performAction">The selector representing the action to perform. You can invoke this selector directly on the object responsible for performing the action or use it to call the appropriate method.</param>		/// <returns>true if the action was performed successfully or false if it was not.</returns>		[Obsolete]		[iOSVersion(3.2)]		[Export("documentinteractionController")]		[Optional]		bool DocumentinteractionController(UIDocumentinteractionController controller, Selector performAction);	}}